import React, { Component } from 'react'

export class Weath extends Component {
  render() {
    return (
      <div>
        <form>
        <div className='weathDiv1'>Узнайте погоду в вашем городе</div>
        <input className='weathInp1' placeholder='введите в какои городе' />
        <button className='weathBt1'>Узнать погоду</button>
        </form>
      </div>
    )
  }
}

export default Weath
